TITLE:
  - Test for line-based coupling between artery network (including
  - scalar transport) and PoroMultiphaseScatra-Framework.
  - Mortar penalty coupling method is employed with partitioned
  - algorithm
PROBLEM TYPE:
  PROBLEMTYPE: "Multiphase_Poroelasticity_ScaTra"
POROMULTIPHASESCATRA DYNAMIC:
  NUMSTEP: 5
  MAXTIME: 0.5
  TIMESTEP: 0.1
  ITEMAX: 25
  COUPALGO: "twoway_partitioned_sequential"
  ARTERY_COUPLING: true
POROMULTIPHASESCATRA DYNAMIC/MONOLITHIC:
  TOLRES_GLOBAL: 1e-07
  TOLINC_GLOBAL: 1e-07
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
POROFLUIDMULTIPHASE DYNAMIC:
  THETA: 1
  LINEAR_SOLVER: 1
  INITIALFIELD: "field_by_function"
  INITFUNCNO: 1
  FLUX_PROJ_SOLVER: 2
POROFLUIDMULTIPHASE DYNAMIC/ARTERY COUPLING:
  ARTERY_COUPLING_METHOD: "MP"
  COUPLEDDOFS_ART: "1"
  COUPLEDDOFS_PORO: "5"
  REACFUNCT_ART: "10"
  SCALEREAC_ART: "-1"
  REACFUNCT_CONT: "0 0 12 0 0"
  SCALEREAC_CONT: "0 0 1 0 0"
  EVALUATE_IN_REF_CONFIG: false
  PRINT_OUT_SUMMARY_PAIRS: true
POROMULTIPHASE DYNAMIC/PARTITIONED:
  RELAXATION: "Aitken"
  MINOMEGA: 0.01
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 1
  NUMSTEP: 10
  THETA: 1
  SKIPINITDER: true
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  DEFINITION_TAU: "Zero"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  CONVTOL: 1e-08
  ABSTOLRES: -1
SCALAR TRANSPORT DYNAMIC/ARTERY COUPLING:
  ARTERY_COUPLING_METHOD: "MP"
  COUPLEDDOFS_ARTSCATRA: "2"
  COUPLEDDOFS_SCATRA: "2"
  REACFUNCT_ART: "11 0"
  SCALEREAC_ART: "-1 0"
  REACFUNCT_CONT: "13 0"
  SCALEREAC_CONT: "1 0"
ARTERIAL DYNAMIC:
  DYNAMICTYPE: "Stationary"
  SOLVESCATRA: true
  LINEAR_SOLVER: 1
  INITFUNCNO: 2
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "solver"
