FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.1"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 3
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.2"
  - COMPONENT: 4
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.1*x+1.0"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.2*x+1.0"
FUNCT3:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "v"
  - VARIABLE: 0
    NAME: "v"
    TYPE: "multifunction"
    NUMPOINTS: 3
    TIMES: [0, 1, 1000]
    DESCRIPTION: ["1000.0*0.5*(1-cos(t*pi/1.0))", "1000.0"]
FUNCT4:
  - VARFUNCTION: "0.0"
FUNCT5:
  - VARFUNCTION: "0.0"
FUNCT6:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 3
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
FUNCT7:
  - VARFUNCTION: "0.0"
FUNCT8:
  - SYMBOLIC_FUNCTION_OF_TIME: "t"
FUNCT9:
  - SYMBOLIC_FUNCTION_OF_SPACE_TIME: "x*y*t"
FUNCT10:
  - VARFUNCTION: "pi*D*0.1*(p_art-p3)"
FUNCT11:
  - VARFUNCTION: "pi*D*0.8*(phi_art1-phi1)+pi*D*0.001*(p_art-p3)*(phi_art1-phi1)"
FUNCT12:
  - VARFUNCTION: "pi*D*1.0*(p_art-p3)"
FUNCT13:
  - VARFUNCTION: "pi*D*8.0*(phi_art1-phi1)+pi*D*0.01*(p_art-p3)*(phi_art1-phi1)"
